import React from 'react';

const List =({ Tasks, getInfo }) => {
    return(
        <ul>
            {
                Tasks.map((Task, index) => <input 
                                            key={index} 
                                            value={Task} 
                                            style={{width: 400}} />)
            }
        </ul>
    )
}

export default List;
